interface CardProps {
    img:string,
    text:string,
    // sub:string
  }

export const MainDashboardCard:React.FC<CardProps> = ({text,img}) => {

    return(
        <div>
            <IonCard className="green-card" 
            // href={`/goto?query=${text}`}
            onClick={()=>clickfn(text)}
